import React, { useState } from 'react';
import Link from 'next/link'; 

const instaPhotos = [
  '../public/insta-photos/1-action.jpeg',
  '../public/insta-photos/2-action.jpeg',
  '../public/insta-photos/3-action.jpeg',
  '../public/insta-photos/4-action.jpeg',
  '../public/insta-photos/5-action.jpeg',
  '../public/insta-photos/6-action.jpeg',
  '../public/insta-photos/7-action.jpeg',
  '../public/insta-photos/8-action.jpeg',
  '../public/insta-photos/9-action.jpeg',
  '../public/insta-photos/10-action.jpeg',
  '../public/insta-photos/11-action.jpeg',
  '../public/insta-photos/12-action.jpeg',
  '../public/insta-photos/15-action.jpeg',
  '../public/insta-photos/17-action.jpeg',
]

function shopInsta(props) {
  use
  return (
    <div className="shop-insta">
      <h1>shop insta</h1>
      <div className="insta-grid">
        {
          instaPhotos.map(p => {
            <span style={{ backgroundImage: `${p}` }} className="insta-photo"></span>
          })
        }
      </div>
      <Link href='/'>
        <a>BACK HOME</a>
      </Link>
    </div>
  );
}

export default shopInsta;
